import React from "react";

class VideoList extends React.Component{

    VideoItems =() => {
        this.props.Response.data.items.map(item => {
            return console.log(item)
        })
    }

    render(){
        return (
                <div>
                    <VideoItems />
                </div>
            )
    }
}

export default VideoList;
